Trucker (2008)  

Verenigde Staten
Drama
90 minuten

geregisseerd door James Mottern
met Michelle Monaghan, Nathan Fillion en Benjamin Bratt

Een vrouwelijke vrachtwagenchauffeur heeft een 11-jarig zoontje van wie zij vervreemd is geraakt. Wanneer zij hem noodgedwongen in huis moet nemen, staat haar zorgenloze leventje ineens op z'n kop.

